      {/* <IsLoading isLoading={isLoading}></IsLoading> */}
      <div className="text-section">
        <h1 className="title">Icons</h1>
        <h4 className="subtitle">Custom Library Created in Illustrator</h4>
      </div>
    </article>
  );
}
